import React from 'react';
import styled from 'styled-components';

// Create a styled component for the logo
const Logo = styled.div`
  font-family: 'SF Pro', -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Oxygen',
    'Ubuntu', 'Cantarell', 'Fira Sans', 'Droid Sans', 'Helvetica Neue', sans-serif;
  font-size: 2em;
  font-weight: bold;
  color: ${(props) => props.theme.primaryColor || 'white'};
  display: flex;
  align-items: center;
  justify-content: center;
  width: 50px;
  height: 50px;
  background-color: ${(props) => props.theme.accentColor || '#007bff'};
  border-radius: 50%;
  text-align: center;
`;

const LogoComponent = () => {
  return (
    <Logo>
      NY
    </Logo>
  );
};

export default LogoComponent;
